description:
When American minister Reverend T. Lawrence Shannon is expelled from his Virginia church, he travels to Mexico in search of his destiny and sanity. There he becomes a tour guide for a bus load of spinsters and a teenage nymphet named Charlotte Goodall, who is being chaperoned by the group's leader, the inflexible Judith Fellowes. Miss Fellowes, who is quite jealous of Charlotte's attentions to Shannon, discovers the young woman in his room and vows to have him fired. To thwart her plot, Shannon takes control of the bus from Hank, the bus driver, and speeds the tour group on a wild ride through the Mexican jungle to the crumbling, secluded hotel of an old friend, the recently widowed Maxine Falk. Eventually Shannon becomes enamored with another guest at the hotel, the rather genteel Hanna Jelkes, an itinerant quick sketch artist and her poet grandfather Nonno. As the wise Hanna partially restores Shannon's fractured world


